import styles from './Education.module.css';
import EducationCard from './EducationCard';

function Education() {
  return (
    <div className={styles.content_dark}>
      <div className={styles.topic_name}>
        <div className={styles.left}>
          <div className={styles.icon}></div>
          <div>Education</div>
        </div>

        <div className={styles.right}>
          <div className={styles.yellow_line}></div>
        </div>

        <div className={styles.bulge}></div>
      </div>

      <div className={styles.school_wrapper}>
        <EducationCard
          title="Delhi Public School"
          place="Burdwan"
          subtitle="Central Board of Secondary Education"
          info={[
            "Completed 12th (2024) with 94%",
            "Completed 10th (2022) with 96.6%",
          ]}
        />

        <EducationCard
          title="Indian Institute of Engineering"
          place="Science and Technology, Shibpur"
          subtitle="B.Tech, Information Technology (2024–2028)"
          info={[
            "Completed Sem-I with 9.25 sgpa",
            "Completed Sem-II with 9.5 sgpa",
          ]}
        />
      </div>
    </div>
  );
}

export default Education;
